		<h1 style="margin: 0px;font-weight: bold;">Tony Joseph <small> 1987</small></h1>
		
		<p style="margin: 10px;">
			横看成岭侧成峰，远近高低各不同，貌合神离像素低，像雾像雨又像风，怎么跟你形容涅？
		</p>
		
		<p style="margin: 10px;">

		</p>

		<script type = "text/javascript">
			$(function()
			{
				$('#portrait').eraser(
				{
					progressFunction: function(p) 
					{
						$('#progress').html(Math.round(p*100)+'%');
					}
				});
				
				$('#resetBtn').click(function(event) 
				{
					$('#portrait').eraser('reset');
					$('#progress').html('0%');
					event.preventDefault();
				});
				
				$('#clearBtn').click(function(event) 
				{
					$('#portrait').eraser('clear');
					$('#progress').html('100%');
					event.preventDefault();
				});
			});
		</script>
